export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},zHUHRwEg1v:{data:{id:2767,attributes:{imdbId:"tt2935622",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzAwNzNlMmQtNDQ2YS00MDgyLTg2ZDYtY2UxZTM3MjE2OWJmXkEyXkFqcGdeQXVyNjU5OTQxMDU@._V1_SX300.jpg",type:b,ratings:[],item_lang:{data:{id:3434,attributes:{title:h,plot:"Sophie had waited her entire life to be kidnapped by the School Master and taken away to train to be a fairytale hero at The School for Good and Evil. However, Agatha, who is unliked by many for being considered a witch, is not ready to give up her only friend and must stop Sophie from going, this ending up as joining her. As the two get whisked away into the deathly secretive world of Fairytales, they find that their fortunes are reversed, much to Sophie's dismay. Finding it impossible to escape from the treacherous world, they find that the only way out, is through a fairytale.",slug:"the-school-for-good-and-evil"}}},books:{data:[{id:13152,attributes:{title:"The School for Good and Evil: The Ever Never Handbook",description:"THE SCHOOL FOR GOOD AND EVIL will soon be a major motion picture from Netflix—starring Academy Award winner Charlize Theron, Kerry Washington, Laurence Fishburne, Michelle Yeoh, Sofia Wylie, Sophie Anne Caruso, Jamie Flatters, Earl Cave, Kit Young, and more! Soman Chainani’s New York Times bestselling series The School for Good and Evil returns with The Ever Never Handbook! Gorgeous full-color illustrations bring your favorite characters like Sophie, Agatha, and Tedros back to school through maps, quizzes, alumni portraits, and more. Wish you could go to the School for Good and Evil? Join the ranks of heroes and villains who have walked these hallowed halls and mastered what it takes to succeed in their own fairy tales. Surviving the trials and tribulations of the school is no walk in the park. The Ever Never Handbook is here to help. This handbook equips new students with everything they’ll need to excel at the School for Good and Evil. Good luck! Don't miss the thrilling conclusion to the beloved series, The School for Good and Evil #6: One True King!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZjjOCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2016-07-12",publisher:c,subtitle:d}},{id:13153,attributes:{title:"The School for Good and Evil #4: Quests for Glory",description:"THE SCHOOL FOR GOOD AND EVIL will soon be a major motion picture from Netflix—starring Academy Award winner Charlize Theron, Kerry Washington, Laurence Fishburne, Michelle Yeoh, Sofia Wylie, Sophie Anne Caruso, Jamie Flatters, Earl Cave, Kit Young, and more! With every end comes a new beginning in the fourth installment of Soman Chainani’s New York Times bestselling School for Good and Evil series, Quests for Glory. If Good and Evil can’t find a way to work together, neither side will survive... Join Sophie, Agatha, Tedros, and the other students as they begin a new era in the Endless Woods—The Camelot Years—where Evers and Nevers alike must move beyond the bounds of school and into the biggest, boldest adventures of their lives. The students at the School for Good and Evil thought they had found their final Ever After when they vanquished the malevolent School Master. Now, on their required fourth-year quests, the students face obstacles both dangerous and unpredictable, and the stakes are high: success brings eternal adoration, and failure means obscurity forever. For their quests, Agatha and Tedros are trying to return Camelot to its former splendor as queen and king. For her quest, Dean Sophie seeks to mold Evil in her own image. But soon they all feel themselves growing more isolated and alone. When their classmates’ quests plunge into chaos, however, someone must lead the charge to save them... Don't miss the thrilling conclusion to the beloved series, The School for Good and Evil #6: One True King!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rGtEDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2017-09-19",publisher:c,subtitle:d}},{id:13154,attributes:{title:h,description:"Best friends Sophie (princess wannabe) and Agatha (witchy loner) are headed (via kidnapping) to the School for Good and Evil, but their assumed destinies are reversed: Sophie's dumped into the School for Evil for Uglification and Henchmen Training classes, while Agatha attends Princess Etiquette and Animal Communication at the School for Good, and when a certain prince charming (son of King Arthur) is thrown into the mix, anything can happen! 150,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DfbmnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2013-05-14",publisher:"Harpercollins Childrens Books",subtitle:d}},{id:13155,attributes:{title:"The School for Good and Evil #5: A Crystal of Time",description:"THE SCHOOL FOR GOOD AND EVIL will soon be a major motion picture from Netflix—starring Academy Award winner Charlize Theron, Kerry Washington, Laurence Fishburne, Michelle Yeoh, Sofia Wylie, Sophie Anne Caruso, Jamie Flatters, Earl Cave, Kit Young, and more! In this fifth installment in Soman Chainani’s New York Times bestselling The School for Good and Evil fantasy series, the past will come back to haunt the present. A false king has seized Camelot’s throne, sentencing Tedros, the true king, to death. While Agatha, narrowly escapes the same fate, Sophie is caught in King Rhian’s trap. With her wedding to Rhian approaching, she’s forced to play a dangerous game as her friends’ lives hang in the balance. All the while, King Rhian’s dark plans for Camelot are taking shape. Now the students of the School for Good and Evil must find a way to restore Tedros to the throne before their stories—and the future of the Endless Woods—are rewritten . . . forever. Don't miss the thrilling conclusion to the beloved series, The School for Good and Evil #6: One True King!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UnlbDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2019-03-05",publisher:c,subtitle:d}},{id:13156,attributes:{title:"The School for Good and Evil: The School Years Collection",description:"THE SCHOOL FOR GOOD AND EVIL will soon be a major motion picture from Netflix—starring Academy Award winner Charlize Theron, Kerry Washington, Laurence Fishburne, Michelle Yeoh, Sofia Wylie, Sophie Anne Caruso, Jamie Flatters, Earl Cave, Kit Young, and more! Enjoy the first three books in Soman Chainani's New York Times bestselling series, the School for Good and Evil, in this digital collection, containing The School for Good and Evil, A World without Princes, and The Last Ever After. Journey into a dazzling new world when best friends Sophie and Agatha enter the School for Good and Evil, where ordinary boys and girls are trained to be fairy-tale heroes and villains. Sophie, with her glass slippers and pink dresses, thinks she'll earn top marks at the School for Good. Meanwhile, Agatha, with her shapeless black frocks and wicked black cat, seems a natural fit for the School for Evil. But when the two girls are swept into the Endless Woods, they find their fortunes are reversed. . . . The aftermath leads to unexpected paths, new alliances, and boys that divide them in an exhilarating quest to find their true Ever After. Soman Chainani has created a spectacular world that Rick Riordan, author of the bestselling Percy Jackson and the Olympians series, says \"reimagines the world of fairy tales and will make you question who is good and who is evil\" and Newbery Honor–winning author Ann M. Martin calls \"a fairy tale like no other, complete with romance, magic, humor, and a riddle that will keep you turning pages until the end.\" Don't miss the last three books in the series: Quests for Glory, A Crystal of Time, and One True King!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=trBVCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2015-10-06",publisher:c,subtitle:"Books 1-3"}}]}}},meta:{}}},prerenderedAt:1681703424368}}("Soman Chainani","movie","HarperCollins","",false,"series",1,"The School for Good and Evil"))